Information
------------------------------

Dino Hunt: Canada
Dino Hunt Canada is a new 4-part documentary series that tells the story of six teams of Canadian fossil hunters who discover some of the most important dinosaur finds in the world. Their expeditions take viewers to some of the most stunning locations in Canada, from the red sandstones of Nova Scotia's Bay of Fundy to the moonscape of the Canadian Badlands in Alberta.


1)  The Horned Dinosaur Mysteries 
In northern Alberta scientist try to figure out what killed an entire herd of dinosaurs in one blow. In southern Alberta another team of paleontologists search for the skull bones of what may be a brand new species of horned dinosaurs.

2)  Cutlers Cave and Flying Dinos 
In the Badlands of Alberta a team searches for 100 year old dig site - to find the remains of a 73 million year old armoured dinosaur. In BC location a paleontologist couple tries to airlift a 4000 kg skeleton out of a secret location.

3)  The Dawn of the Dinosaurs 
In the Bay of Fundy, scientists search for the earliest dinosaurs; a team in British Columbia tracks dino-prints up a steep rock face.

4)  The End of the Dinosaurs 
In an attempt to understand the Extinction story, Alberta, scientists look for the skeleton of a rare horned dinosaur, while in Saskatchewan a team find the fossils of the last dinosaurs to walk the Earth.

